import React from "react";
import Header from "./Header";
import Footer from "./Footer";

function Note(){
    
    const note = {
        background: "#fff",
        borderRradius: "7px",
        boxShadow: "0 2px 5px #ccc",
        padding: "10px",
        width: "240px",
        margin: "16px",
        float: "left"
      }

     const noteh1 = {
        fontSize: "1.1em",
        marginBottom: "6px",
      }

      const notep = {
        fontSize: "1.1em",
        marginBottom: "10px",
        whiteSpace: "pre-wrap",
        wordWrap: "break-word"
      }













    return(
        <div style = {note,noteh1,notep}>
            <Header />
             <Footer />
        </div>
        
    ) ;
};




export default Note;
